import React from 'react';
import Item from './Item';
import styled from 'styled-components';

const Liste = styled.div`
	display: flex;
	flex-wrap: wrap;
	flex: 0 1 auto;
	padding-top: 100px;
`;
function startMovie() {
	const trackId = document.getElementById('trackId').innerHTML;
	console.log(trackId);
	return trackId;
}

const ItemsList = ({ items }) => {
	const itemsArray = items.map((item, index) =>
		<Item onClick={() => { startMovie() }} key={index} {...item} />);
	return <Liste>{itemsArray}</Liste>;
};

export default ItemsList;
